import { StyleSheet } from 'react-native';

const ResultStyle = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: '#FFFFFF',
    borderRadius: 30,
  },
  topinfo: {
    backgroundColor: '#48cff4',
    borderRadius: 30,
    width: 375,
    height: 441,
    alignItems: 'center',
    justifyContent: 'center',
  },
  row: {
    marginTop: 40,
    width: 375,
    height: 55,
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: 10,
    gap: 44,
  },
  backmenu: {
    marginLeft: 10,
    width: 55,
    height: 55,
  },
  rectangleA: {
    width: 55,
    height: 55,
    backgroundColor: '#71ddff',
    padding: 5,
    fontSize: 42,
    marginRight: 220,
    borderRadius: 100,
    cursor: 'pointer',
    color: 'rgba(255, 255, 255, 0.4)',
    alignItems: 'center',
    justifyContent: 'center',
  },
  backArrow: {
    fontSize: 30,
  },
  mainphoto: {
    width: 300,
    height: 300,
  },
  content: {
    width: 300,
    height: 300,
  },
  elipse2: {
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center',
    width: 300,
    height: 300,
    borderRadius: 150,
    borderWidth: 3,
    borderColor: 'rgba(255, 255, 255, 0.2)',
  },
  elipse: {
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center',
    width: 275,
    height: 275,
    borderRadius: 137.5,
    backgroundColor: '#FFFFFF',
  },
  camera: {
    width: 250,
    height: 250,
    borderRadius: 125,
  },
  bottominfo: {
    backgroundColor: '#FFFFFF',
    width: 375,
    height: 371,
    borderRadius: 30,
    alignItems: 'center',
    justifyContent: 'center',
  },
  circleChart: {
    position: 'relative',
    width: 250,
    height: 250,
    alignSelf: 'center',
  },
  circleChartBackground: {
    position: 'absolute',
    top: 0,
    left: 0,
    width: '100%',
    height: '100%',
  },
  circleChartCircle: {
    fill: 'transparent',
    strokeWidth: 10,
    strokeLinecap: 'round',
    transform: [{ rotate: '-90deg' }],
    transformOrigin: '50% 50%',
    transition: 'stroke-dashoffset 0.5s ease-in-out',
  },
  circleChartCircleLevel_0: {
    stroke: '#f69d9d',
  },
  circleChartCircleLevel_1: {
    stroke: '#f4cf87',
  },
  circleChartCircleLevel_2: {
    stroke: '#38a6f4',
  },
  circleChartCircleLevel_3: {
    stroke: '#8be0a1',
  },
  contents: {
    alignItems: 'center',
    justifyContent: 'center',
    width: 200,
    height: 200,
    borderRadius: 100,
    position: 'absolute',
    top: '50%',
    left: '50%',
    backgroundColor: '#FF000',
    transform: [{ translateX: -100 }, { translateY: -100 }],
  },
  scanningText: {
    fontStyle: 'normal',
    fontWeight: '700',
    fontSize: 27,
    lineHeight: 24,
    color: '#000',
  },
  resultText: {
    fontStyle: 'normal',
    fontWeight: '700',
    fontSize: 27,
    lineHeight: 24,
    color: '#000',
  },
});

export default ResultStyle;
